import React from "react";
import "./Workout.css";

const Workout = () => {
  return (
    <div className="workout">
      <div className="container">
        <div className="icon">
        <i
          className="fa-solid fa-dumbbell "
          style={{ color: "#D4DDEC", fontSize: "1.5rem" }}
        />
        </div>

        <p>Workout</p>
      </div>
    </div>
  );
};

export default Workout;
